field_event_description:
  -
    value: "<p>Our friends in Helsinki are organizing a fantastic meet-up for our members in Helsinki and this event promises to bring the local community together and brainstorm on new ideas to further establish a solid community in the Finnish region.</p>\r\n\r\n<p>The event is co-sponsored by&nbsp;<a href=\"https://www.eficode.com/\">Eficode</a>&nbsp;and it will surely be an amazing time learning and networking with people with like-minds.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Agenda of the day</strong></p>\r\n\r\n<ul>\r\n\t<li>Welcome and Introduction - Organisers and Local Rep</li>\r\n\t<li>Presentation by <a href=\"http://www.eficode.com/\">Eficode</a> - Message by co-sponsor</li>\r\n\t<li>Keynote by Dmitri Sarle, CEO of <a href=\"http://arcticstartup.com/\">Arctic Startup</a></li>\r\n\t<li>Women for Women workshop Finland, in collaboration with <a href=\"https://www.facebook.com/WfWworkshopFinland/?fref=mentions\">Women of Aalto</a> and <a href=\"https://www.facebook.com/groups/womenEIT/?fref=mentions\">Women@EIT</a></li>\r\n\t<li>Steering and future planning: Presenting ideas, brainstorming and call for volunteers</li>\r\n\t<li>Social post-event: Pizza and Sauna</li>\r\n</ul>\r\n\r\n<p><br />\r\n<a href=\"http://bit.ly/jump-start-helsinki\">REGISTER HERE</a>!</p>\r\n"
    format: full_html
